window.bookSummaryJSON = "<p><b>With every day that passes, the Dark Overlord grows stronger.</b></p> <p>For Ordinal to be safe, he must be stopped. As Windfall's army grows, so does the hope that Jim will prevail.</p> <p>Jim's got other problems, though, including an inside-out demon, an elf plague, missing townspeople, and a lonely badger.</p> <p>With Jim gone, Fenris tries to hold down the fort, but he has an Assassin running free in Windfall and a prickly pair of royals to deal with.</p> <p>Does Ordinal really stand a chance against the ever growing darkness?</p>"; 
